import React from "react";
import PhoneRepair from "../PhoneRepair/phoneRepair";
import apple from '../../../../Assets/Images/Logo/mobile/apple.png';
import asus from '../../../../Assets/Images/Logo/mobile/asus.png';
import blackberry from '../../../../Assets/Images/Logo/mobile/blackberry.png';
import htc from '../../../../Assets/Images/Logo/mobile/htc.png';
import huawei from '../../../../Assets/Images/Logo/mobile/huawei.png';
import lg from '../../../../Assets/Images/Logo/mobile/lg.png';
import nexus from '../../../../Assets/Images/Logo/mobile/nexus.png';
import nokia from '../../../../Assets/Images/Logo/mobile/nokia.png';
import oneplus from '../../../../Assets/Images/Logo/mobile/oneplus.png';
import pixel from '../../../../Assets/Images/Logo/mobile/pixel.png';
import samsung from '../../../../Assets/Images/Logo/mobile/samsung.png';
import sony from '../../../../Assets/Images/Logo/mobile/sony.png';
import styles from './phoneRepairMain.module.css';
import { Link } from "react-router-dom";
import PhoneModel from "../PhoneModel/PhoneModel";


const phoneRepairMain = () => (
    <div className={styles.Main}>
        <Link to="/iPhone">
            <PhoneRepair img={apple} model='Apple' name='apple'/>
        </Link>
        <Link to="/iPhone">
            <PhoneRepair img={asus} model='Asus' name='samsung'/>
        </Link>
        <PhoneRepair img={blackberry} model='Blackberry' />
        <PhoneRepair img={htc} model='HTC' />
        <PhoneRepair img={huawei} model='Huawei' />
        <PhoneRepair img={lg} model='LG' />
        <PhoneRepair img={nexus} model='Nexus' />
        <PhoneRepair img={nokia} model='Nokia' />
        <PhoneRepair img={oneplus} model='One Plus' />
        <PhoneRepair img={pixel} model='Pixel' />
        <PhoneRepair img={samsung} model='Samsung' />
        <PhoneRepair img={sony} model='Sony' />
    </div>
)

export default phoneRepairMain;
